import React from 'react'
import './Iteam.css'
export const Item = () => {
  return (
    <div className='item'>
    <img src={props.image} alt="" />
    <p>{props.name}</p>
    <div className="item-prices">
        <div className="item-price-new">
           {props.new_price}
        </div>
        <div className="item-price-old ">
            {props.old_pric}
        </div>
    </div>
    </div>
  )
}
export default Item;
